import React from "react";
import Button from "../../../ui/button/button";
import Table from "../../../ui/table/Table";

const acquire = (props) => (
  <div>
    <div className="search-area">
      <input type="text" placeholder="Enter Title" />
      <Button btnType="fill">Scrape</Button>
    </div>
    <div className="clr"></div>
    <div className="acquisition-layer">
      <div className="acquired">
        <Table
          headers={props.attributes}
          title="Acquisitions"
          data={props.acquisitions}
        />
      </div>
      <div className="acquire">
        <ul>
          <li>List</li>
          <li>List</li>
          <li>List</li>
        </ul>
      </div>
    </div>
  </div>
);
export default acquire;
